import React from 'react'
import style from "./Boxx.module.css"

function PostItem (props) {
    
    return (
        
        
            <div className={style.post}>
                
                <div className={style.content_1}>
                    НАЗВАНИЕ ЗАДАЧИ
                </div>
            <input type="text" value=""></input>
                <div className={style.content_1}>
                    ПРИОРИТЕТ
                </div>
                <div className={style.content_1}>
                    ОТМЕТКИ
                </div>
                <div className={style.content_1}>
                    ОПИСАНИЕ
                </div>
                
            </div>
           
    );
};

export default PostItem;
